import React from "react";
import "./Page.css";
import List from "./List";

function Page({ mainCookie, additional }) {
    const additionalArray = Array.isArray(additional) ? additional : [];

  return (
    <div className="Page">
        <div className = "circle">
        {mainCookie && /\.(jpg|jpeg|png|gif)$/.test(mainCookie) ? (
            <img src={mainCookie} alt="Circle Content" className="profpic" />
        ) : (
            <p className="section-name">{mainCookie}</p>
        )}
        </div>
        <div className = "section-info">
            {Array.isArray(additional) ? (
                <List data={additional} />
            ) : (
                <p className="additional-info">{additional}</p>
            )}
        </div>

    </div>
  );
}

export default Page;
